Select * from Articulos
where ART_CodigoArticulo = '0216'


Select	ALM_CodigoAlmacen, 
		ALM_Nombre, 
		LOC_CodigoLocalidad,
		LOC_Nombre,
		LOC_Planear,
		LOC_LocalidadGeneral,
		LOC_ALM_AlmacenId,
		LOC_LocalidadId
from Almacenes 
inner join Localidades on ALM_AlmacenId = LOC_ALM_AlmacenId
